<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>World Chat</title>
  <script src="https://www.gstatic.com/firebasejs/8.10.1/firebase-app.js"></script>
  <script src="https://www.gstatic.com/firebasejs/8.10.1/firebase-database.js"></script>
  <script src="kaiads.v5.min.js"></script>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      background-color: #f4f4f9;
      color: #333;
      margin: 0;
      height: 100vh;
      display: flex;
      flex-direction: column;
      overflow: hidden;
    }

    header {
      background: linear-gradient(45deg, #ff6f61, #ff9a8b);
      color: white;
      text-align: center;
      padding: 8px;
      font-size: 14px;
      font-weight: bold;
      position: relative;
      width: 100%;
      z-index: 10;
      display: flex;
      justify-content: space-between;
      align-items: center;
    }

    .online-count {
      font-size: 12px;
      margin-right: 10px;
    }

    .navItem {
      display: block;
      width: 90%;
      margin: 8px auto;
      padding: 8px;
      font-size: 14px;
      border-radius: 6px;
      border: 1px solid #ccc;
      background: linear-gradient(145deg, #fff, #e4e4e4);
      transition: all 0.3s ease;
    }

    .navItem:focus {
      outline: 2px solid #007bff;
      border-color: #007bff;
    }

    button {
      background: linear-gradient(45deg, #1e90ff, #00bfff);
      color: black;
      border: none;
      cursor: pointer;
      font-size: 14px;
      font-weight: bold;
      padding: 8px 16px;
      width: 80%;
      border-radius: 6px;
      margin-top: 8px;
      transition: background 0.3s ease;
    }

    button:hover {
      background: linear-gradient(45deg, #00bfff, #1e90ff);
    }

    button:focus {
      border: 2px solid yellow;
    }

    #worldChatPage {
      flex: 1;
      overflow: auto;
      display: none;
    }

    #worldChatPage.active {
      display: flex;
      flex-direction: column;
    }

    #chatBox {
      position: relative;
      flex: 1;
      overflow-y: auto;
      padding: 8px;
      background-color: #e9ecef;
      border-top: 1px solid #ccc;
    }

    .message {
      padding: 8px;
      margin: 6px 0;
      border-radius: 6px;
      max-width: 70%;
      font-size: 12px;
    }

    .sent {
      background: linear-gradient(45deg, #1e90ff, #00bfff);
      color: white;
      align-self: flex-end;
    }

    .received {
      background: linear-gradient(45deg, #f0f0f0, #ffffff);
      color: #333;
      align-self: flex-start;
    }

    .mentioned {
      background: #fff3cd;
      color: #333;
      align-self: flex-start;
    }

    #messageInputContainer {
      display: flex;
      align-items: center;
      padding: 8px;
      background-color: #f8f9fa;
      border-top: 1px solid #ccc;
      gap: 8px;
      flex-direction: column;
    }

    #messageInput {
      flex: 1;
      padding: 8px;
      font-size: 14px;
      border: 1px solid #ccc;
      border-radius: 4px;
      background-color: #fff;
      color: #333;
      width: 100%;
    }

    #autocompleteList {
      width: 100%;
      max-height: 100px;
      overflow-y: auto;
      background-color: #fff;
      border: 1px solid #ccc;
      border-radius: 4px;
      display: none;
      flex-direction: column;
      z-index: 100;
    }

    .autocomplete-item {
      padding: 8px;
      font-size: 14px;
      cursor: pointer;
      background: linear-gradient(145deg, #fff, #e4e4e4);
      border-bottom: 1px solid #eee;
    }

    .autocomplete-item:hover,
    .autocomplete-item:focus {
      background: linear-gradient(145deg, #e4e4e4, #fff);
      outline: 2px solid #007bff;
    }

    .typing-message {
      font-style: italic;
      color: gray;
      padding: 4px 8px;
      margin-top: 4px;
      background: rgba(0, 0, 0, 0.1);
      border-radius: 6px;
      width: fit-content;
      max-width: 80%;
      position: absolute;
      bottom: 0;
      right: 8px;
    }

    #cooldownMessage {
      text-align: center;
      padding: 8px;
      background-color: #ffcccc;
      color: #333;
      font-size: 14px;
      display: none;
    }

    #banMessage {
      text-align: center;
      padding: 10px;
      background-color: #ffcccc;
      color: #333;
      font-size: 14px;
      display: none;
    }
  </style>
</head>
<body>
  <div id="worldChatPage" class="active">
    <header>
      <span>World Chat</span>
      <span id="onlineCount" class="online-count">Online: 0</span>
    </header>
    <div id="banMessage">
      You are banned. Remaining time: <span id="banRemainingTime"></span>
    </div>
    <div id="chatBox">
      <div class="empty-message"></div>
    </div>
    <div id="typingIndicator" style="display: none;"></div>
    <div id="cooldownMessage"></div>
    <div id="messageInputContainer">
      <div id="autocompleteList"></div>
      <input type="text" id="messageInput" class="navItem" placeholder="Enter your message" tabindex="4" />
    </div>
  </div>
